import Comment from "./Comment"
import { CardContent, makeStyles } from "@material-ui/core"

const Comments = (props) => {
  return (
    <CardContent>
      {props.comments.map((comment) => {
        return <Comment comment={comment}></Comment>
      })}
    </CardContent>
  )
}

export default Comments
